import React, { Component } from 'react';


class anasayfa extends Component {
    render() {
        return (
            <div>
                
                <Header></Header>
                <p></p>
                <KayanKisim></KayanKisim>
                <AnaKisim></AnaKisim>
              
              
                <AltHeader></AltHeader>
            </div>
        )
    }
}
export default anasayfa;
